import './index.css';
import * as React from "react";
import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";
import Login from './routes/login';
import MainRoute from './routes/mainRoute';
import Error from './routes/error';
import Serials from './routes/serials';
import { loader } from './routes/serials';
import {getAllSerials} from './api';

const router = createBrowserRouter([
  {
    path: "/",
    element: < MainRoute />,
    errorElement: <Error />,
    children:[
      {
        path: "serials/",
        element: <Serials/>,
        loader: getAllSerials,
      }
    ]
  },
  {
    path: "/login",
    element: <Login />,
  },
]);


function App() {
  return <RouterProvider router={router} />;
}

export default App;
